import React, { Component } from 'react';
class Home extends Component {
  render() {
    return (
        <div class="row">
            <div class="col">
                <img src="https://img.icons8.com/android/24/000000/left.png" ></img>
            </div>
            <div class="col">
                <img src="https://img.icons8.com/material-outlined/24/000000/home--v2.png" class="col-4"></img>
            </div>
            <div class="col">
            <img src="https://img.icons8.com/android/24/000000/logout-rounded-down.png" class="col-4"></img>
            </div>
        </div>
    );
  }
}

export default Home;
